render() {
    return (

        <Grid.Row columns='equal'>
            <Grid.Column>
                <p className='beerColor'>{this.props.iterator} {this.props.beer.name}</p>
            </Grid.Column>

            <Grid.Column>
                <p>{this.props.beer.tagline}</p>
            </Grid.Column>
        </Grid.Row>


    )
}

}

export default OneBeer;
